mPxhoPZRzSU1HnUHXpW97K2LGetsXRxGLljxnRFYQbzRgkuMsNLBwOcCE59TDtslLKPQ-SS"},"webResponseContextExtensionData":{"hasDecorated":true}},"playabilityStatus":{"status":"UNPLAYABLE","reason":"Video unavailable","errorScreen":{"playerErrorMessageRenderer":{"subreason":{"simpleText":"This content isn’t available."},"reason":{"simpleText":"Video unavailable"},"thumbnail":{"thumbnails":[{"url":"//s.ytimg.com/yts/img/meh7-vflGevej7.png","width":140,"height":100}]},"icon":{"iconType":"ERROR_OUTLINE"}}},"contextParams":"Q0FFU0FnZ0M="},"videoDetails":{"videoId":"q0jVqkg4F6I","title":"READY PLAYER ONE - Trailer 2 - Oficial Warner Bros. Pictures","lengthSeconds":"156","keywords":["cine","estreno","cartelera","película","video","trailer","avance","adelanto","marzo warner bros pictures latam","warner bros pictures","warner bros latam","latam","español","latino","ready player one","steven spielberg","ernest cline","t j miller","simon pegg","tye sheridan","acción","futuro","ciencia ficción","aventura","tecnología","premio","oasis","libros","adaptación","el juego comienza","videojuegos","vr","realidad virtual","gigante de acero","freddy krueger","volver al futuro","delorean","ochentas","pacman","et","jurassic park","libro"],"channelId":"UCu-cVVMn41qUA-pwdEhNqhg","isOwnerViewing":false,"shortDescription":"Del cineasta Steven Spielberg, llega la aventura de acción de ciencia ficción \"Ready Player One: El Juego Comienza\".  Se basa en el bestseller de Ernest Cline del mismo nombre, que se ha convertido en un fenómeno mundial.\r\n\r\nLa película se establece en 2045, con el mundo al borde del caos y el colapso. La gente ha encontrado la salvación en el OASIS, un universo expansivo de realidad virtual creado por el brillante y excéntrico James Halliday (Mark Rylance). Cuando Halliday muere, deja su inmensa fortuna a la primera persona que encuentre un objeto digital que ha escondido en algún lugar del OASIS. Esto provoca un concurso que abarca todo el mundo. Cuando un joven héroe llamado Wade Watts (Tye Sheridan) decide unirse al concurso, se lanza a una búsqueda de tesoros vertiginosa y realista a través de un fantástico universo de misterio, descubrimiento y peligro.\r\n\r\nSpielberg dirigió la película con un guión de Zak Penn y Ernest Cline. La película fue producida por Spielberg, Donald De Línea, Kristie Macosko Krieger y Dan Farah; Con Adam Somner, Daniel Lupi, Chris DeFaria y Bruce Berman como productores ejecutivos.\r\n\r\n\"Ready Player One: El Juego Comienza\", protagonizada por Tye Sheridan (\"X-Men: Apocalypse\", \"Mud\"), Olivia Cooke (\"Yo y Él y Raquel\", \"Bates Motel\"), Ben Mendelsohn (Rogue One, Bloodline) y TJ Miller (\"Deadpool\", \"Silicon Valley\"), con Simon Pegg (lde las sagas \"Star Trek\", y \"Misión: Imposible\") y el ganador del Oscar Mark Rylance (\"Puente de espías\", próximo \"Dunkerque\").\r\n\r\nSpielberg (\"Schindler's List\", \"El soldado Ryan\") reunió a su equipo creativo de \"Bridge of Spies\", incluyendo al director de fotografía ganador del Oscar Janusz Kaminski (Lista de Schindler), el productor ganador del Oscar, Adam Stockhausen, el editor ganador del Oscar, Michael Kahn, y la diseñadora de vestuario Kasia Walicka-Maimone (\"Moonrise Kingdom\"). La música está escrita por el compositor nominado al Oscar Alan Silvestri ( de las películas \"Back to the Future\", \"Forrest Gump\").\r\n\r\nWarner Bros. Pictures y Amblin Entertainment presentan, en asociación con Village Roadshow Pictures, una producción de Amblin, una producción de De Line Pictures, una película de Steven Spielberg, \"Ready Player One: El Juego Comienza\".\r\nLa película será distribuida por Warner Bros. Pictures, una Warner Bros. Entertainment Company, y en territorios selectos por Village Roadshow Pictures.\r\n\r\nMantente informado en: http://warnerbroslatino.com\r\nSíguenos en Facebook: https://www.facebook.com/WarnerBrosPicturesLatinoamerica\r\nEn Twitter: https://twitter.com/WBPicturesLatam\r\nEn Instagram: https://www.instagram.com/wbpictu scondido en algún lugar del OASIS. Esto provoca un concurso que abarca todo el mundo. Cuando un joven héroe llamado Wade Watts (Tye Sheridan) decide unirse al concurso, se lanza a una búsqueda de tesoros vertiginosa y realista a través de un fantástico universo de misterio, descubrimiento y peligro.\r\n\r\nSpielberg dirigió la película con un guión de Zak Penn y Ernest Cline. La película fue producida por Spielberg, Donald De Línea, Kristie Macosko Krieger y Dan Farah; Con Adam Somner, Daniel Lupi, Chris DeFaria y Bruce Berman como productores ejecutivos.\r\n\r\n\"Ready Player One: El Juego Comienza\", protagonizada por Tye Sheridan (\"X-Men: Apocalypse\", \"Mud\"), Olivia Cooke (\"Yo y Él y Raquel\", \"Bates Motel\"), Ben Mendelsohn (Rogue One, Bloodline) y TJ Miller (\"Deadpool\", \"Silicon Valley\"), con Simon Pegg (lde las sagas \"Star Trek\", y \"Misión: Imposible\") y el ganador del Oscar Mark Rylance (\"Puente de espías\", próximo \"Dunkerque\").\r\n\r\nSpielberg (\"Schindler's List\", \"El soldado Ryan\") reunió a su equipo creativo de \"Bridge of Spies\", incluyendo al director de fotografía ganador del Oscar Janusz Kaminski (Lista de Schindler), el productor ganador del Oscar, Adam Stockhausen, el editor ganador del Oscar, Michael Kahn, y la diseñadora de vestuario Kasia Walicka-Maimone (\"Moonrise Kingdom\"). La música está escrita por el compositor nominado al Oscar Alan Silvestri ( de las películas \"Back to the Future\", \"Forrest Gump\").\r\n\r\nWarner Bros. Pictures y Amblin Entertainment presentan, en asociación con Village Roadshow Pictures, una producción de Amblin, una producción de De Line Pictures, una película de Steven Spielberg, \"Ready Player One: El Juego Comienza\".\r\nLa película será distribuida por Warner Bros. Pictures, una Warner Bros. Entertainment Company, y en territorios selectos por Village Roadshow Pictures.\r\n\r\nMantente informado en: http://warnerbroslatino.com\r\nSíguenos en Facebook: https://www.facebook.com/WarnerBrosPic o que abarca todo el mundo. Cuando un joven héroe llamado Wade Watts (Tye Sheridan) decide unirse al concurso, se lanza a una búsqueda de tesoros vertiginosa y realista a través de un fantástico universo de misterio, descubrimiento y peligro.\r\n\r\nSpielberg dirigió la película con un guión de Zak Penn y Ernest Cline. La película fue producida por Spielberg, Donald De Línea, Kristie Macosko Krieger y Dan Farah; Con Adam Somner, Daniel Lupi, Chris DeFaria y Bruce Berman como productores ejecutivos.\r\n\r\n\"Ready Player One: El Juego Comienza\", protagonizada por Tye Sheridan (\"X-Men: Apocalypse\", \"Mud\"), Olivia Cooke (\"Yo y Él y Raquel\", \"Bates Motel\"), Ben Mendelsohn (Rogue One, Bloodline) y TJ Miller (\"Deadpool\", \"Silicon Valley\"), con Simon Pegg (lde las sagas \"Star Trek\", y \"Misión: Imposible\") y el ganador del Oscar Mark Rylance (\"Puente de espías\", próximo \"Dunkerque\").\r\n\r\nSpielberg (\"Schindler's List\", \"El soldado Ryan\") reunió a su equipo creativo de \"Bridge of Spies\", incluyendo al director de fotografía ganador del Oscar Janusz Kaminski (Lista de Schindler), el productor ganador del Oscar, Adam Stockhausen, el editor ganador del Oscar, Michael Kahn, y la diseñadora de vestuario Kasia Walicka-Maimone (\"Moonrise Kingdom\"). La música está escrita por el compositor nominado al Oscar Alan Silvestri ( de las películas \"Back to the Future\", \"Forrest Gump\").\r\n\r\nWarner Bros. Pictures y Amblin Entertainment presentan, en asociación con Village Roadshow Pictures, una producción de Amblin, una producción de De Line Pictures, una película de Steven Spielberg, \"Ready Player One: El Juego Comienza\".\r\nLa película será distribuida por Warner Bros. Pictures, una Warner Bros. Entertainment Company, y en territorios selectos por Village Roadshow Pictures.\r\n\r\nMantente informado en: http://warnerbroslatino.com\r\nSíguenos en Facebook:   / warnerbrospictureslatinoamerica  \r\nEn Twitter:   / wbpictureslatam  \r\nEn Instagram:   /  aventura de acción de ciencia ficción \"Ready Player One: El Juego Comienza\".  Se basa en el bestseller de Ernest Cline del mismo nombre, que se ha convertido en un fenómeno mundial.\r\n\r\nLa película se establece en 2045, con el mundo al borde del caos y el colapso. La gente ha encontrado la salvación en el OASIS, un universo expansivo de realidad virtual creado por el brillante y excéntrico James Halliday (Mark Rylance). Cuando Halliday muere, deja su inmensa fortuna a la primera persona que encuentre un objeto digital que ha escondido en algún lugar del OASIS. Esto provoca un concurso que abarca todo el mundo. Cuando un joven héroe llamado Wade Watts (Tye Sheridan) decide unirse al concurso, se lanza a una búsqueda de tesoros vertiginosa y realista a través de un fantástico universo de misterio, descubrimiento y peligro.\r\n\r\nSpielberg dirigió la película con un guión de Zak Penn y Ernest Cline. La película fue producida por Spielberg, Donald De Línea, Kristie Macosko Krieger y Dan Farah; Con Adam Somner, Daniel Lupi, Chris DeFaria y Bruce Berman como productores ejecutivos.\r\n\r\n\"Ready Player One: El Juego Comienza\", protagonizada por Tye Sheridan (\"X-Men: Apocalypse\", \"Mud\"), Olivia Cooke (\"Yo y Él y Raquel\", \"Bates Motel\"), Ben Mendelsohn (Rogue One, Bloodline) y TJ Miller (\"Deadpool\", \"Silicon Valley\"), con Simon Pegg (lde las sagas \"Star Trek\", y \"Misión: Imposible\") y el ganador del Oscar Mark Rylance (\"Puente de espías\", próximo \"Dunkerque\").\r\n\r\nSpielberg (\"Schindler's List\", \"El soldado Ryan\") reunió a su equipo creativo de \"Bridge of Spies\", incluyendo al director de fotografía ganador del Oscar Janusz Kaminski (Lista de Schindler), el productor ganador del Oscar, Adam Stockhausen, el editor ganador del Oscar, Michael Kahn, y la diseñadora de vestuario Kasia Walicka-Maimone (\"Moonrise Kingdom\"). La música está escrita por el compositor nominado al Oscar Alan Silvestri ( de las películas \"Back to the Future\", \"Forrest Gump\").\r\n\r\nWarner Bros. Pictures y Amblin Entertainment presentan, en asociación con Village Roadshow Pictures, una producción de Amblin, una producción de De Line Pictures, una película de Steven Spielberg, \"Ready Player One: El Juego Comienza\".\r\nLa película será distribuida por Warner Bros. Pictures, una Warner Bros. Entertainment Company, y en territorios selectos por Village Roadshow Pictures.\r\n\r\nMantente informado en: http://warnerbroslatino.com\r\nSíguenos en Facebook:   / warnerbrospictureslatinoamerica  \r\nEn Twitter:   / wbpictureslatam  \r\nEn Instagram:   / wbpictureslatam  ","commandRuns":[{"startIndex":2422,"length":27,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBQQ040EGAUiEwjg1qO8ov-PAxUkLmgIHeaCN1NIoq_gwaS1taSrAcoBBOABQLw=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbU5KWlRvSXV6T29BWFFuUnhhZVFidXNOSzFYQXxBQ3Jtc0tuMnByTmVuSGZ5dnVHOVZ2R3JzTDNZRllXWDdBMU1sYXg5eXlUX1JRWTBkRkgycXNsMUhNVkNvYmZ5MGhmRXJ1Y0dabHZtUnVKdnI3b2p6ZEFvNlliV00wa1FyeTRneFpJZHNSTUV5YWRiQmV2N1hKaw\u0026q=http%3A%2F%2Fwarnerbroslatino.com%2F\u0026v=q0jVqkg4F6I","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbU5KWlRvSXV6T29BWFFuUnhhZVFidXNOSzFYQXxBQ3Jtc0tuMnByTmVuSGZ5dnVHOVZ2R3JzTDNZRllXWDdBMU1sYXg5eXlUX1JRWTBkRkgycXNsMUhNVkNvYmZ5MGhmRXJ1Y0dabHZtUnVKdnI3b2p6ZEFvNlliV00wa1FyeTRneFpJZHNSTUV5YWRiQmV2N1hKaw\u0026q=http%3A%2F%2Fwarnerbroslatino.com%2F\u0026v=q0jVqkg4F6I","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2473,"length":37,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBQQ040EGAUiEwjg1qO8ov-PAxUkLmgIHeaCN1NIoq_gwaS1taSrAcoBBOABQLw=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbk51MDZKV0ZJSFhGSUdWWnJubFM5Q2xhZkJNUXxBQ3Jtc0tuQk9vVmRMTVpycXl4OS1SZ1ZTWTdFUG
